import React from 'react';
import {useRef} from 'react';
import './css/home.css';

//image import
import Banner from '../images/banner.png';
import Tech from '../images/tech.png';
import Kid from '../images/kid.png';
import Cook from '../images/cook.png';
import Cafe from '../images/cafe.png';
import Profile from '../images/profile.jpg';
import Facebook from '../images/facebook-bw.png';
import Twitter from '../images/twitter-bw.png';
import Linkedin from '../images/linkedin-bw.png';
import Instagram from '../images/intagram-bw.png';



function Home() {
    const ref = useRef(null);

  const handleClick = () => {
    ref.current?.scrollIntoView({behavior: 'smooth'});
  };
  return (
  <div>
  <div class="section-1">
        <h1 className='topic'>Life style</h1>

        <div className='container-h'>
          <button className='btn-1'>Login</button>
          <br/>~or~<br/>
          <button className='btn-2'>Register</button>
          <br/><br/>
          <img className='profile' src={Profile} alt='profile'/>
          <br/>
          <h2>DHANUSHKA</h2>
          <h1>Owner</h1>of Life_style
        </div>

        <div className='trans'></div>

        <center><button className='btn' onClick={handleClick}><div class="chevron"></div>
        <div class="chevron"></div>
        <div class="chevron"></div></button></center>

        <a href="/"><img className='social-link' src={Facebook} alt='facebook'/></a>
        <a href="/"><img className='social-link' src={Twitter} alt='Twitter' style={{left:'8vw'}}/></a>
        <a href="/"><img className='social-link' src={Linkedin} alt='Linkedin'style={{left:'11vw'}}/></a>
        <a href="/"><img className='social-link' src={Instagram} alt='Instagram'style={{left:'14vw'}}/></a>
  </div>


  <div className="section-2" ref={ref}>

    <div className='container-1'>
          <div className='container-box'style={{marginRight:'10vw'}}>
          <a href='/resturant'>
            <img className='anime-image' src={Cafe} alt='resturant'/>Resturant</a>
          </div>
          <div className='container-box'>
          <a href='/res'>
            <img className='anime-image' src={Cook} alt='recepie'/> Recipece</a>
            </div>
          <div className='container-box'>
            <a href='/kids'>
              <img className='anime-image' src={Kid} alt='kids'/>Kids</a>
            </div>
          <div className='container-box'>
          <a href='/tech'>
            <img className='anime-image' src={Tech} alt='tech'/> Technology</a>
            </div>
    </div>

        <br/>
        <div className='container'><img className='banner-img' src={Banner} alt='banner'/></div>
        <br/>
        <div className='container-1' style={{height:'12vw',backgroundColor:'#ffffff00'}}>
          
          
        </div>
        <br/>

      </div>
</div>
  );
}

export default Home;
